import{_ as a}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as t,c as r,a8 as _,o as l}from"./chunks/framework.BDnHobkS.js";const R=JSON.parse('{"title":"Режим повернення (фіксоване крило)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_modes_fw/return.md","filePath":"uk/flight_modes_fw/return.md"}'),i={name:"uk/flight_modes_fw/return.md"};function d(o,e,n,h,L,T){return l(),r("div",null,e[0]||(e[0]=[_('<h1 id="режим-повернення-фіксоване-крило" tabindex="-1">Режим повернення (фіксоване крило) <a class="header-anchor" href="#режим-повернення-фіксоване-крило" aria-label="Permalink to &quot;Режим повернення (фіксоване крило)&quot;">​</a></h1><img src="'+a+'" title="Position fix required (e.g. GPS)" width="30px"><p>Режим польоту <em>Return</em> використовується для <em>повернення транспортного засобу до безпеки</em> по вільному шляху до безпечного пункту призначення, де він може приземлитися.</p><p>Літаки з фіксованим крилом за замовчуванням використовують тип повернення до призначення <a href="./../flight_modes/return.html#mission-landing-rally-point-return-type-rtl-type-1">місії посадки/точка збору</a>, і завжди передбачається, що у них буде завдання з шаблоном посадки. З цією конфігурацією режим повернення зумовлює підняття транспортного засобу на мінімальну безпечну висоту над перешкодами (якщо потрібно), польот до початку схеми посадки, визначеної у плані місії, і далі слідує за нею для посадки.</p><p>Фіксоване крило підтримує <a href="./../flight_modes/return.html#return-types-rtl-type">інші типи повернення PX4</a>, включаючи повернення додому/радільної точки, маршрут місії та найближче безпечне місце призначення. За замовчуванням рекомендується використовувати цей тип.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Режим автоматичний - для керування апаратом не потрібно втручання користувача.</li><li>Режим вимагає глобальної оцінки 3D-позиції (з GPS або виведеної з <a href="./../ros/external_position_estimation.html#enabling-auto-modes-with-a-local-position">локальної позиції</a>). <ul><li>Літаючі транспортні засоби не можуть переключатися на цей режим без глобального положення.</li><li>Літаючі транспортні засоби перейдуть в режим аварійної безпеки, якщо втратять оцінку положення.</li></ul></li><li>Режим вимагає встановленої домашньої позиції.</li><li>Режим перешкоджає зброюванню (транспортний засіб повинен бути зброєний при переході на цей режим).</li><li>Перемикачі керування RC можуть використовуватися для зміни режимів польоту на будь-якому транспортному засобі.</li><li>Рух стіків радіокерування ігнорується.</li></ul></div><h2 id="технічнии-підсумок" tabindex="-1">Технічний підсумок <a class="header-anchor" href="#технічнии-підсумок" aria-label="Permalink to &quot;Технічний підсумок&quot;">​</a></h2><p>Літальні апарати з фіксованим крилом за замовчуванням використовують тип повернення до призначення <em>місії посадки/точка збору</em>. У цьому типі повернення транспортний засіб:</p><ul><li>Піднімається на безпечну мінімальну висоту повернення, визначену за допомогою <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> (безпечно вище будь-яких очікуваних перешкод). Транспортний засіб підтримує свою початкову висоту, якщо вона вище, ніж мінімальна висота повернення. Зверніть увагу, що висоту повернення не можна налаштувати, використовуючи параметр &quot;cone&quot; в літаках з фіксованим крилом.</li><li>Летить прямим шляхом на постійній висоті до призначення, яким буде найближча з точки старту місійного маршруту посадки та будь-яка точка збору, або домашня локація, якщо місійний маршрут посадки або точки збору не визначені.</li><li>Якщо призначення - це шаблон посадки місії, воно буде слідувати за шаблоном для посадки.</li><li>Якщо місце призначення - це точка ралі або дім, воно спуститься на висоту спуску, а потім обережно почекає або приземлиться (в залежності від параметрів посадки).</li></ul><p>Очікується, що літальний апарат з фіксованим крилом буде використовувати схему посадки, визначену у місії як пункт повернення, оскільки це найбезпечніший спосіб автоматичної посадки. Це вимога зазвичай виконується параметром <a href="#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a>.</p><p>Місійний маршрут посадки складається з команди <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_LAND_START" target="_blank" rel="noreferrer">MAV_CMD_DO_LAND_START</a>, однієї або кількох позиційних точок та точки посадки <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a>.</p><p>Коли пункт призначення - ралі-пункт або домашнє місце, по прибутті транспортний засіб швидко знизиться на висоту, визначену <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a>, за замовчуванням обертається відповідно навколо пункту призначення нескінчено при радіусі <a href="#RTL_LOITER_RAD">RTL_LOITER_RAD</a>. Транспортний засіб може бути змушений приземлитися у пункті призначення, змінивши <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a> так, щоб він не був -1. У цьому випадку транспортний засіб приземлиться так само, як <a href="./../flight_modes_fw/land.html">Режим посадки</a>.</p><h2 id="параметри" tabindex="-1">Параметри <a class="header-anchor" href="#параметри" aria-label="Permalink to &quot;Параметри&quot;">​</a></h2><p>Параметри RTL перелічені в <a href="./../advanced_config/parameter_reference.html#return-mode">Референсі параметрів &gt; Режим повернення</a>. Якщо використовується місійна посадка, значення <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> та <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> є важливими. Інші параметри стають актуальними, якщо призначенням є точка збору або домашня локація.</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="RTL_TYPE"></a><a href="./../advanced_config/parameter_reference.html#RTL_TYPE">RTL_TYPE</a></td><td>Тип повернення.</td></tr><tr><td><a id="RTL_RETURN_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_RETURN_ALT">RTL_RETURN_ALT</a></td><td>Висота повернення в метрах (за замовчуванням: 60 м). Якщо вже знаходиться вище цієї висоти, транспортний засіб повернеться на поточну висоту.</td></tr><tr><td><a id="RTL_DESCEND_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a></td><td>Мінімальна висота повернення і висота, на якій повітряне судно сповільнює або зупиняє своє початкове зниження з вищої висоти повернення (за замовчуванням: 30 м)</td></tr><tr><td><a id="RTL_LAND_DELAY"></a><a href="./../advanced_config/parameter_reference.html#RTL_LAND_DELAY">RTL_LAND_DELAY</a></td><td>Час очікування на висоті <code>RTL_DESCEND_ALT</code> перед посадкою (за замовчуванням: 0.5 с) - за замовчуванням цей період короткий, щоб транспортний засіб просто сповільнився, а потім враз відразу приземлився. Якщо встановлено значення -1, система буде кружляти на висоті <code>RTL_DESCEND_ALT</code> замість посадки. Затримка надається для того, щоб ви могли налаштувати час для розгортання шасі для посадки (автоматично спрацьовує).</td></tr><tr><td><a id="RTL_LOITER_RAD"></a><a href="./../advanced_config/parameter_reference.html#RTL_LOITER_RAD">RTL_LOITER_RAD</a></td><td>[Тільки фіксоване крило] Радіус круга обертання (у значенні <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>).</td></tr><tr><td><a id="MIS_TKO_LAND_REQ"></a><a href="./../advanced_config/parameter_reference.html#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a></td><td>Вкажіть, чи потрібна місія для посадки або злітної траєкторії необхідна. Фіксовані крила, як правило, потребують цього.</td></tr></tbody></table><h2 id="дивіться-також" tabindex="-1">Дивіться також <a class="header-anchor" href="#дивіться-також" aria-label="Permalink to &quot;Дивіться також&quot;">​</a></h2><ul><li><a href="./../flight_modes/return.html">Режим повернення (Загальний)</a></li><li><a href="./../flight_modes_mc/return.html">Режим повернення (Мультикоптер)</a></li><li><a href="./../flight_modes_vtol/return.html">Режим повернення (VTOL)</a></li></ul>',17)]))}const s=t(i,[["render",d]]);export{R as __pageData,s as default};
